@brianegan Thanks for the clarification! I'm trying to understand if the plugin was activated or not. Do you recall if the device selector was visible? It is in the menu bar, toward the right-hand side. It is the `<no-devices>` drop-down in this image.

<img width="342" alt="screen shot 2018-11-07 at 7 35 26 am" src="https://user-images.githubusercontent.com/8518285/48141463-d1893200-e25f-11e8-9ab7-b927a9a45dd7.png">

It is possible your workshop attendee had a version of Android Studio for which the plugin did not fully function. There was a build problem, since fixed, that prevented AS-specific features from being activated in some of the later 3.2 preview versions.

@RohitSurwase The information is ambiguous.
